import './index.css';
import React from 'react';
import ReactDOM from "react-dom";
import App from "./App";
import {addPost, RootStateType, state, subscribe, updateNewPostText} from "./redux/state";


export const render = (state: RootStateType) => {
    ReactDOM.render(
        <App state={state} addPostCallback={addPost} updateNewPostText={updateNewPostText}/>,
        document.getElementById('root')
    );
};

render(state);

subscribe(render);
